#   https://leetcode.com/problems/remove-all-adjacent-duplicates-in-string

#   https://leetcode.com/problems/remove-all-adjacent-duplicates-in-string/discuss/295517/Python-100-Stack


class Solution:
    #   Wrong Answer
    def removeDuplicates0(self, S):
        if S is None or 0 == len(S):
            return S
        l = list(S)
        i = 0
        while i < len(l) - 1:
            j = i + 1
            if l[i] != l[j]:
                i += 1
                continue
            while j < len(l) and l[i] == l[j]:
                j += 1
            l[i:j] = ''
            if 0 < i:
                i -= 1
            else:
                i = 0
        return ''.join(l)

    #   Time Limit Exceeded
    def removeDuplicates1(self, S):
        if S is None or 0 == len(S):
            return S

        def removeRecur(s):
            i = 1
            while i < len(s):
                if s[i - 1] == s[i]:
                    return removeRecur(s[:i - 1] + s[i + 1:])
                i += 1
            return s

        return removeRecur(S)

    #   runtime; 104ms, 46.25%
    #   memory; 13.3MB, 100.00%
    def removeDuplicates(self, S):
        if S is None or 0 == len(S):
            return S
        l = list(S)
        i = 1
        while i < len(l):
            if l[i - 1] == l[i]:
                l[i - 1:i + 1] = ''
                if 1 < i:
                    i -= 1
                else:
                    i = 1
            else:
                i += 1
        return ''.join(l)


s = Solution()
data = [('abbaca', 'ca'),
        ('abbbaca', 'abaca'),
        ('abca', 'abca'),
        ('abcabba', 'abc'),
        ('aabcabba', 'bc'),
        ('aaaaaaaaa', 'a'),
        ('', ''),
        ]
for S, expected in data:
    real = s.removeDuplicates(S)
    if len(S) < 10:
        print('{}, expected {}, real {}, result {}'.format(S, expected, real, expected == real))
    else:
        print('{}..., expected {}, real {}, result {}'.format(S[:10], expected[:10], real[:10], expected == real))
